import React from 'react'
import Die from './components/Die'
export default function App() {
    function allNewDice() {
        let arr = []
        for (let i = 0; i < 10; ++i){
            let random = Math.floor(Math.random() * 6 + 1)
            arr.push(random)
        }
        return arr
    }
    const allDice = allNewDice().map(die => <Die value={die} />)


    return (
        <main>
            <div className="container">
                {allDice}
            </div>
        </main>
    )
}
